import { CircularProgressBar } from "@tomickigrzegorz/react-circular-progress-bar";
import styled from "styled-components";


const Text = styled.p`
    position : absolute;
    top : 25%
    left : 25%
`

function CicleProgress() {

    return (
        <>
            <CircularProgressBar
                colorCircle="#ededed"
                colorSlice="#e54e21"
                percent={80}
                fontColor="#e54e21"
                round={true}
                fontSize="15px"
                textPosition="1.5rem"
            >
            Server
            </CircularProgressBar>
        </>
    )

}

export default CicleProgress
